import React from "react";
import { useParams } from "react-router-dom";

const QuoteDetail = () => {
    const params = useParams();

    return (
        <div>
            <h1>Quote Detail</h1>
            <h2>{params.quoteId}</h2>
        </div>
    )
}

export default QuoteDetail;
